    return(
        <div className="mid">
            <Container fluid>
                <Row className="justify-content-md-center">
                    <Col xs lg="8" style={{marginBottom:'1rem',marginTop:'1rem',padding:'0rem'}}>
                        <h3>Latest News on Health</h3>
                        <span className="fade-line"></span>
                    </Col>
                </Row>
            </Container>
        </div>
    )
}
export default AboutCoronavirus;
